import './App.css';
import Main from './view/Main';
import { BrowserRouter, Route} from 'react-router-dom';

function App() {
  return (
      <BrowserRouter basename = '/'>
        <Route path = '/' component = {Main}></Route>
      </BrowserRouter>
  );
}

export default App;
